script: |
  super -f text -I q73.spq | sort > q73.out

inputs:
  - name: q73.spq
    data: |
      SELECT DISTINCT + ( - CAST ( NULL AS INTEGER ) ) AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - - col1 * col0 * - - CAST ( NULL AS INTEGER ) * - + col1 BETWEEN col0 AND + col0;
  - name: tab1

outputs:
  - name: q73.out
    data: |
